import React from "react";
import Login from "./Login";
import Compose from "./compose";

import { BrowserRouter, Routes, Route } from "react-router-dom";

function App() {
  
  return (
    <div>
      <BrowserRouter>
        <Routes>
          <Route path="/" element={<Login />} />
          <Route path="/compose" element={<Compose />} />
        </Routes>
      </BrowserRouter>
    </div>

  );
}

export default App;
